import React, { Component } from 'react';
import Login from './Login';

import Button from 'antd/es/button';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Login />

        <Button type="primary">Button</Button>
      </div>
    );
  }
}

export default App;
